import React from "react";
import adminLayout from "../hoc/adminLayout"

class HomePage extends React.Component {
    constructor(props){
        super(props);

        this.state = {}
    }

    render(){
        return <>
            <iframe title="HomePage" width="1500" height="900" src="https://app.powerbi.com/reportEmbed?reportId=e3cf2815-ed46-476f-8f3b-e2701174c90c&autoAuth=true&ctid=3dce8bf6-d374-4bbf-92c0-aafa67adb68e" frameborder="0" allowFullScreen="true"></iframe>
        </>
    }
}

export default adminLayout(HomePage);
